import React, { useEffect, useState } from "react";
import pb from "../utils/pocketbaseClient";
import RealWorldBox from "./RealWorldBox";
import { formatNumber } from "../utils/formatNumber";
import { useTheme } from "../context/ThemeContext";

function parseScientific(val) {
  if (val == null) return null;
  if (typeof val === "number") return val;
  if (typeof val === "object" && "value" in val) return val.value;
  if (typeof val === "string") {
    const parsed = parseFloat(val.replace(/[^0-9.eE+-]/g, ""));
    return isNaN(parsed) ? null : parsed;
  }
  return null;
}

function Converter({ category }) {
  const [units, setUnits] = useState([]);
  const [selectedUnits, setSelectedUnits] = useState([]);
  const [realWorldItems, setRealWorldItems] = useState([]);
  const [selectedItems, setSelectedItems] = useState([]);
  const [inputValue, setInputValue] = useState("");
  const [displayScientific, setDisplayScientific] = useState([false, false, false]);
  const [childUnits, setChildUnits] = useState([]);
  const theme = useTheme();

  useEffect(() => {
    async function fetchData() {
      try {
        const units = await pb.collection("units").getFullList({
          filter: `category="${category}"`,
        });
        const items = await pb.collection("real_world_items").getFullList({
          filter: `category="${category}"`,
        });

        const others = units.filter((u) => u.to_base_factor !== null);
        const sortedItems = items.sort((a, b) => {
          const aVal = a.expression === "∞" ? Number.POSITIVE_INFINITY : parseScientific(a.scientific_value);
          const bVal = b.expression === "∞" ? Number.POSITIVE_INFINITY : parseScientific(b.scientific_value);
          return aVal - bVal;
        });

        const filteredSorted = sortedItems.filter((item) => item.expression !== "∞");

        setChildUnits(others);
        setSelectedUnits(others.slice(0, 3).map((u) => u.id));
        setRealWorldItems(sortedItems); // full list including ∞ items
        setSelectedItems([
          filteredSorted[0] || null,
          filteredSorted[1] || null,
          filteredSorted[2] || null,
        ]);
      } catch (error) {
        console.error("Error loading data:", error);
      }
    }

    fetchData();
  }, [category]);

  const handleInputChange = (e) => {
    setInputValue(e.target.value);
  };

  const handleUnitChange = (index, id) => {
    const updated = [...selectedUnits];
    updated[index] = id;
    setSelectedUnits(updated);
  };

  const handleItemChange = (index, id) => {
    const updated = [...selectedItems];
    const item = realWorldItems.find((i) => i.id === id);
    updated[index] = item || null;
    setSelectedItems(updated);
  };

  const handleToggleScientific = (index) => {
    setDisplayScientific((prev) => {
      const updated = [...prev];
      updated[index] = !updated[index];
      return updated;
    });
  };

  return (
    <div className="w-full grid grid-cols-1 md:grid-cols-3 gap-4">
      {selectedUnits.map((unitId, index) => {
        const unit = childUnits.find((u) => u.id === unitId);
        const convertedValue =
          inputValue && unit
            ? parseFloat(inputValue) * parseScientific(unit.to_base_factor)
            : "";

        return (
          <div
            key={index}
            className="p-4 rounded-2xl shadow-md"
            style={{
              backgroundColor: theme?.outputBoxBackground || "#ffffff",
              color: theme?.outputTextColor || "#000000",
            }}
          >
            <div className="text-xl font-semibold mb-2">
              {convertedValue ? formatNumber(convertedValue, displayScientific[index]) : "---"}
            </div>
            <select
              className="w-full p-2 rounded border"
              value={unitId || ""}
              onChange={(e) => handleUnitChange(index, e.target.value)}
            >
              {childUnits.map((u) => (
                <option key={u.id} value={u.id}>
                  {u.name}
                </option>
              ))}
            </select>
            <div className="flex justify-end mt-2">
              <button
                onClick={() => handleToggleScientific(index)}
                className="text-sm underline"
              >
                {displayScientific[index] ? "General" : "Scientific"}
              </button>
            </div>
          </div>
        );
      })}

      {selectedItems.map((item, index) => (
        <RealWorldBox
          key={index}
          item={item}
          allItems={realWorldItems}
          onChange={(id) => handleItemChange(index, id)}
          inputValue={inputValue}
          displayScientific={displayScientific[index]}
          onToggle={() => handleToggleScientific(index)}
        />
      ))}
    </div>
  );
}

export default Converter;
